import { useRoutes } from "react-router-dom";
import { AuthContext } from "./auth/authContext";
import Themeroutes from "./routes/Router";

const App = () => {
  const routing = useRoutes(Themeroutes);

  return (
  <div>
    <AuthContext.Provider>
          {routing}
    </AuthContext.Provider>

  </div>
  );
};

export default App;
